import React from 'react'
import { Table } from 'semantic-ui-react'
import PlayerBio from './players_bio.json'

const headerRow = ['Name', 'Team', 'Position', 'ID']

const renderBodyRow = ({ name, team, position, id }, i) => ({
  key: id || `row-${i}`,
  cells: [
    name || 'No name specified',
    team,
    positions,
    id
  ],
})

const PlayerTable = () => (
  <Table
    sortable
    color='purple'
    celled
    headerRow={headerRow}
    renderBodyRow={renderBodyRow}
    tableData={PlayerBio}
  />
)

export default PlayerTable
